import React, { useState } from 'react';
import { MDBContainer, MDBStepper, MDBStep, MDBBtn, MDBIcon } from 'mdb-react-ui-kit';

export default function Stepper() {
  const [activeStep, setActiveStep] = useState(0);

  const handleNext = () => {
    setActiveStep(activeStep + 1);
  };

  const handlePrev = () => {
    setActiveStep(activeStep - 1);
  };

  return (
    <MDBContainer>
      <MDBStepper form>
        <MDBStep active={activeStep === 0}>
          <a href="#step1" onClick={() => setActiveStep(0)}>
            Step 1
          </a>
          <div className="label">Step 1</div>
        </MDBStep>
        <MDBStep active={activeStep === 1}>
          <a href="#step2" onClick={() => setActiveStep(1)}>
            Step 2
          </a>
          <div className="label">Step 2</div>
        </MDBStep>
        <MDBStep active={activeStep === 2}>
          <a href="#step3" onClick={() => setActiveStep(2)}>
            Step 3
          </a>
          <div className="label">Step 3</div>
        </MDBStep>
      </MDBStepper>

      <div>
        {activeStep === 0 && (
          <div id="step1">
            <h3>Step 1 Content</h3>
            <MDBBtn color="primary" onClick={handleNext}>
              Next <MDBIcon icon="angle-double-right" className="ml-1" />
            </MDBBtn>
          </div>
        )}

        {activeStep === 1 && (
          <div id="step2">
            <h3>Step 2 Content</h3>
            <MDBBtn color="secondary" onClick={handlePrev}>
              <MDBIcon icon="angle-double-left" className="mr-1" /> Previous
            </MDBBtn>
            <MDBBtn color="primary" onClick={handleNext}>
              Next <MDBIcon icon="angle-double-right" className="ml-1" />
            </MDBBtn>
          </div>
        )}

        {activeStep === 2 && (
          <div id="step3">
            <h3>Step 3 Content</h3>
            <MDBBtn color="secondary" onClick={handlePrev}>
              <MDBIcon icon="angle-double-left" className="mr-1" /> Previous
            </MDBBtn>
            <MDBBtn color="primary">
              Finish <MDBIcon icon="check" className="ml-1" />
            </MDBBtn>
          </div>
        )}
      </div>
    </MDBContainer>
  );
}
